INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (2, 0, 1, 7, 2834, "ペコリーヌとの出会い", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 91002, 8, 40, 5118061, 0, "青空の下で謁見", "フリーマーケット会場", 10118);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (2, 0, 1, 7, 2835, "マホとの出会い", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 91002, 8, 40, 5118062, 0, "未来の騎空団\nマスコット？", "フリーマーケット会場", 10118);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (2, 0, 1, 7, 2837, "アキノとの出会い", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 91002, 8, 40, 5118063, 0, "お嬢さまからの\n緊急依頼", "ランドソル市街地", 10118);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (2, 0, 1, 18, 4108402, "ジュンとの出会い", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 91002, 8, 40, 5118064, 0, "黄金色の悩みごと", "フリーマーケット会場", 10118);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (2, 0, 1, 18, 4107402, "カオリとの出会い", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 91002, 8, 40, 5118065, 0, "白熱！　格闘大会！", "フリーマーケット会場", 10118);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (2, 0, 1, 16, 9000227, "ニノンとの出会い", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 91002, 8, 40, 5118066, 1, "祭り太鼓はオーエドの華", "オーエド町", 10118);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (3, 0, 1, 19, 2101181, "スズナとの出会い", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 91002, 8, 40, 5118067, 0, "人気者は遅れて\nやってくる", "フリーマーケット会場", 10118);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (3, 0, 1, 18, 4109402, "ナナカとの出会い", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 91002, 8, 40, 5118068, 0, "巫女・ミーツ・魔法少女", "ランドソル市街地", 10118);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (3, 0, 1, 18, 4305402, "キャル＆コッコロとの出会い", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 91002, 8, 40, 5118069, 0, "ネズ耳は二度なくなる", "フリーマーケット会場", 10118);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (3, 0, 1, 18, 4101402, "ユカリとの出会い", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 91002, 8, 40, 5118070, 0, "この出会いにカンパイ！", "ランドソル市街地", 10118);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (3, 0, 1, 18, 4106402, "アオイとの出会い", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 91002, 8, 40, 5118071, 0, "陰陽アンサンブル", "ランドソル市街地", 10118);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (3, 0, 1, 7, 2836, "シノブとの出会い", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 91002, 8, 40, 5118072, 1, "運試し十番勝負！", "フリーマーケット会場", 10118);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (1, 10145115, 0, 0, 0, "オープニング", 0, 0, 0, 0, 5118600, 0, "彼女たちの新たな日常", 0, 10118);
